import { Routes, Switch, Route, Router as RouterX} from 'react-router-dom';
import Landing from './Landing';

function Router(){
    return(
        <RouterX>
        <Routes>

                <Route path='/' component={Landing}></Route>
                <Route path='/forum' component={Landing}></Route>

        </Routes>

        </RouterX>
    );
}

export default Router;
